-- The vast majority of the information is correct with minor changes such as new items/price changes. The structure would be the same.

-- Table structure for table `lpRequiredItems`
-- The additional items required to purchase (if applicable)
-- Fields - parentID, typeID, quantity
-- parentID - Refers to StoreID in table 'lpstore'
-- typeID - the ID of the item(s) needed to purchase, multiple items would require multiple entries
-- quantity - the quantity of the items needed

DROP TABLE IF EXISTS `lpRequiredItems`;

CREATE TABLE IF NOT EXISTS `lpRequiredItems` (
  `parentID` int(10) NOT NULL,
  `typeID` int(10) NOT NULL,
  `quantity` int(10) NOT NULL,
  KEY `parentID` (`parentID`),
  KEY `typeID` (`typeID`),
  KEY `parentID_2` (`parentID`),
  KEY `typeID_2` (`typeID`),
  KEY `parentID_3` (`parentID`),
  KEY `typeID_3` (`typeID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

