--
-- Table structure for table `lpStore`
-- lpStore
-- What objects appear listed in the store and where.
-- Fields - storeID, corporationID, typeID, quantity, lpCost, iskCost
-- storeID - incremental number (Using example 102)
-- corporationID - The corp ID (1000002 = CBD Corporation)
-- typeID - The id of the item being sold (17636 = Raven Navy Issue)
-- quantity - quantity of the item being sold
-- lpCost - price in LP (Raven Navy Issue = 600000)
-- iskCost - prise in ISK (if any)

DROP TABLE IF EXISTS `lpStore`;

CREATE TABLE IF NOT EXISTS `lpStore` (
  `storeID` int(5) unsigned NOT NULL AUTO_INCREMENT,
  `corporationID` int(10) NOT NULL,
  `typeID` int(10) NOT NULL,
  `quantity` int(10) NOT NULL,
  `lpCost` int(10) NOT NULL,
  `iskCost` int(10) NOT NULL,
  PRIMARY KEY (`storeID`),
  KEY `corporationID` (`corporationID`),
  KEY `typeID` (`typeID`),
  KEY `typeID_2` (`typeID`),
  KEY `corporationID_2` (`corporationID`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=29141 ;

